.approvers-sort-body {
  .list {
    height: 360px;
    font-size: 14px;
    border: 1px solid #d9d9d9;
    border-radius: 2px;
    .selected-item {
      width: 100%;
      padding: 0px 12px;
      display: flex;
      justify-content: space-between;
      align-items: center;

      &.selected-item-user {
        &:last-child {
          .selected-item-main {
            border-bottom-color: transparent;
          }
        }
        .selected-item-main {
          display: flex;
          align-items: center;
          height: 50px;
          width: 100%;
          box-sizing: border-box;
        }
        .selected-item-headIcon {
          flex-shrink: 0;
        }
        .selected-item-text {
          min-width: 0;
          flex: 1;
          margin-left: 10px;
          .name {
            height: 20px;
            line-height: 20px;
            font-size: 14px;
            margin-bottom: 2px;
            overflow: hidden;
            text-overflow: ellipsis;
            white-space: nowrap;
          }
          .organize {
            height: 17px;
            line-height: 17px;
            color: #999999;
            font-size: 12px;
            overflow: hidden;
            text-overflow: ellipsis;
            white-space: nowrap;
          }
        }
      }
      span {
        max-width: 90%;
        white-space: nowrap;
        overflow: hidden;
        text-overflow: ellipsis;
      }
      .option-drag {
        cursor: move;
        color: #606266;
        .icon-ym-darg {
          font-size: 20px;
          display: inline-block;
        }
      }
    }
  }
}
